import React,{useEffect} from 'react'
import Axios from 'axios'


const DisplayTeachers = (props) => {

    let name= props.str;
    let names= [];
    
    Axios.get("http://localhost:3001/search",{params: { name : name}}).then((response)=>{
        console.log(response.data);
        response.data.map((data,index)=>{
            console.log(response.data[index].name);
            names.push(response.data[index].name); 
        })
    });

    useEffect(()=>{
        handleClick();
    },[names]);

    let dbdata = [];
    const handleClick = () => {
        names.map((name)=>{
            Axios.get("http://localhost:3001/profile",{params: { name : names}}).then((response)=>{
                dbdata.push(response.data);
                console.log(dbdata);
            });
        })
            
        
    }

    return (
        <div>
            <h1>{name}</h1>
            {
                dbdata.map((i)=>{
                    console.log(i.date,i.starttime);
                    return(
                        <div>
                            <div>
                                {name},{i.date},{i.starttime},{i.endtime},{i.task}
                            </div>
                            <button>
                                Add
                            </button>
                        </div>
                    )
                })
            }
            {/* <button onClick={() => {
                handleClick(names)}
            }>Click here</button> */}
        </div>
    )
}

export default DisplayTeachers
